import React, { Component } from "react";
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';
import { Redirect } from 'react-router-dom';
import { Link } from 'react-router-dom';

class BuyerLogin extends Component {
    // postLogins = function () {
    //     this.props.postLogin().then(
    //         () => {
    //             this.props.history.push("/profile");
    //         }
    //     )
    // };

    render() {
        return (
            <section>
                <div class="container-fluid my-5">
                    <div class="row">
                        <div class="col-12 col-md-4"></div>
                        <div class="col-12 col-md-4">
                            <div class="card box-signin px-3">
                                <article class="card-body">
                                    <Link to="#" class="float-right btn blue-btn">Sign up</Link>
                                    <h4 class="card-title mb-4 mt-1"><strong>Sign In as Buyer</strong></h4>
                                    <form>
                                        <div class="form-group">
                                            <input name="" class="form-control" placeholder="Username" type="text" />
                                        </div>
                                        <div class="form-group">
                                            <a class="float-right forgot" href="#">Forgot?</a>
                                            <input class="form-control" placeholder="Password" type="password" />
                                        </div>
                                        <div class="form-group">
                                            <div class="checkbox">
                                                <label><input type="checkbox" /> Save password </label>
                                            </div>
                                        </div>
                                        <div class="form-group">
                                            <button type="submit" class="btn blue-btn btn-block"> Sign In </button>
                                        </div>
                                    </form >
                                </article >
                            </div>
                        </div>
                        <div class="col-12 col-md-4"></div>
                    </div>
                </div>
            </section>
        );
    }
}

export default withRouter(BuyerLogin);
